INSERT INTO `notificacoes` (`id`, `titulo`, `data_publicacao`, `descricao`, `link`, `icon`, `lida`) VALUES
(1, 'Novos recursos em breve!', '2023-11-15', 'Estou empolgado em compartilhar que novas funcionalidades estão a caminho no nosso sistema! Estamos trabalhando duro para tornar a experiência ainda melhor. Fiquem atentos às próximas atualizações e, se tiverem sugestões, estamos de ouvidos abertos. Obrigado pela confiança!\n\nAbraços,', NULL, 'fa fa-bell-o', '0'),
(6, 'Apresento a vocês o novo CRMCORBAN!', '2023-11-29', 'Queremos compartilhar uma ótima notícia com você: o nosso sistema passou por uma renovação completa e está de cara nova!\r\n\r\nAs melhorias incluem uma interface mais intuitiva, recursos aprimorados e uma experiência de usuário mais fluida. Estamos sempre buscando maneiras de aprimorar nossos serviços para proporcionar a você a melhor experiência possível.\r\nExplore as novidades e, se tiver alguma dúvida ou feedback, não hesite em nos contatar. Estamos aqui para garantir que você aproveite ao máximo todas as funcionalidades.\r\nAgradecemos pela sua confiança em nossa plataforma. Estamos animados com essa evolução e esperamos que você também aproveite!', NULL, 'fa fa-bullhorn', '0');
